[heaters_extra]
[pid_calibrate_extra]
[rotation_distance]

[include axes.cfg]
[include boot.cfg]
[include debug.cfg]
#[include display.cfg]
[include extruder.cfg]
[include fans.cfg]
[include filament.cfg]
[include filament_sensor.cfg]
[include heater_bed.cfg]
[include host.cfg]
[include kiauh_macros.cfg]
[include macros.cfg]
[include pins.cfg]
[include probe.cfg]
[include print_macro.cfg]
#[include resonance_mcu.cfg]
#[include resonance_nano.cfg]
#[include resonance_rpi.cfg]
[include reset.cfg]
#[include sensors.cfg]
[include timelapse.cfg]
[include tmc.cfg]

[mcu]
serial: /dev/serial/by-id/usb-Klipper_stm32f446xx_5D0032000551393038383735-if00
restart_method: command

[printer]
#delta_radius: 134.4
kinematics: delta
max_velocity: 800
max_accel: 8000
max_accel_to_decel: 8000
max_z_velocity: 300
minimum_z_position: -5
print_radius: 125
square_corner_velocity: 5

[display_status]
[endstop_phase]
[exclude_object]

[firmware_retraction]
retract_length: 0.3
retract_speed: 30
unretract_speed: 40

[force_move]
enable_force_move: True

[gcode_arcs]
resolution: 0.1

[idle_timeout]
gcode:
  {% if printer.webhooks.state|lower == 'ready' %}
    {% if printer.pause_resume.is_paused|lower == 'false' %}
      M117 
      M84
      TURN_OFF_HEATERS
    {% endif %}
  {% endif %}
timeout: 6000

[pause_resume]
recover_velocity: 400

[respond]

[save_variables]
filename: ~/delta_data/config/variables.cfg

[virtual_sdcard]
path: ~/delta_data/gcodes

